import { Routes, Route } from 'react-router-dom';
import {HomePage} from '../views/index';

export function RoutesPag(){
    return(
            <Routes>
                <Route path="/" element={Home}/>
                <Route path="*" element={
                    <h1>ERROR 404 No se encuentra el documento</h1>
                }/>
            </Routes>
    );
};
